import React from 'react';

const CancelPage = () => {
    return (
        <div>
            <h2>Payment Cancelled</h2>
            <p>We noticed you cancelled your payment. If you faced any issues, please contact support.</p>
            <a href="/">Return to homepage</a>
        </div>
    );
}

export default CancelPage;
